import React, { Fragment } from 'react'
import MainComponent from './MainComponent'
import { Provider } from 'react-redux'
const store = createStore(reducer)

const App = ({ children }) => (
    <Fragment>
        <Provider store={store}>
            <MainComponent />
        </Provider>
        { children }
    </Fragment>
)

export default App
